import React from "react";
import Header from "../header/header";
import Footer from "../footer/footer";

const Layout = ({ children }) => {
    return (
        <>
            <Header />
            <main>
            {React.Children.map(children, child => {
                    return (
                        <div key={child.key}>
                            {child}
                        </div>
                    );
                })}
            </main>
            <Footer />
        </>
    );
}

export default Layout;
